"use strict";angular.module("sparFinder",[]),angular.module("sparFinder").controller("mapCTRL",["$scope","dataService",function(e,n){window.initMap=function(){n.getUsers(function(n){e.users=n.data.users,e.centerLatLng={lat:e.users[0].lat,lng:e.users[0].lng},e.map=new google.maps.Map(document.getElementById("map"),{center:e.centerLatLng,scrollwheel:!1,zoom:10});for(var r=0;r<e.users.length;r++)new google.maps.Marker({map:e.map,position:e.users[r],title:"Hello World!"})})}}]),angular.module("sparFinder").service("dataService",["$http",function(e){this.getUsers=function(n){e.get("/api/users").then(n)}}]);